chapters/Basis/new操作符.html.body:
new操作符

new创建一个对象都进行了哪些操作：

创建一个空对象，用this 变量引用该对象并继承该函数的原型
属性和方法加入到this的引用对象中
新创建的对象由this所引用，并且最后隐式的返回this


模拟过程
function newObj(Fun,arguments) {
    var o = {};
    if (Fun && typeof Fun === "function") {
        o.__proto__ = Fun.prototype;
        Fun.apply(o, arguments);
        return o;
    }
}

new操作符返回机制
无return
function Thing() {
    this.one = 1;
    this.two = 2;
}
var myThing = new Thing();
console.log(myThing.one); // 1
console.log(myThing.two); // 2

return 基本类型
function Thing() {
    this.one = 1;
    this.two = 2;
    return 5;
}
var myThing = new Thing();
console.log(myThing.one); // 1
console.log(myThing.two); // 2
console.log(myThing); // Thing {one: 1, two: 2}

return 引用类型
function Thing() {
    this.one = 1;
    this.two = 2;
    return {
        three: 3,
        four: 4
    };
}
var myThing = new Thing();
console.log(myThing.one); // undefined
console.log(myThing.two); // undefined
console.log(myThing.three); // 3
console.log(myThing.four); // 4
console.log(myThing); // Object {three: 3, four: 4}

chapters/Basis/this.html.body:
this

this 永远指向函数运行时所在的对象，而不是函数创建时所在的对象；
匿名函数和不处于任何对象中的函数，This指向window；
call, apply, with指的This是谁就是谁；
普通函数调用，函数被谁调用，This就指向谁；
如果有new关键字，this指向new出来的那个对象;

var x = 0;
var foo = {
    x:1,
    bar:{
        x:2,
        baz: function () {
            console.log(this.x)
        }
    }
};
var a = foo.bar.baz;
foo.bar.baz(); // 2
a()//0

对象、闭包中的this
var x = 0;
var foo = {
    x:1,
    bar:function () {
        console.log(this.x);
        var that = this;
        return function () {//这块代码不是foo的一部分（return出来的）
            console.log(this.x);
            console.log(that.x);
        }
    }
};
foo.bar(); //1
foo.bar()();//1 0 1

